import { StyleSheet } from "react-native";

export const s = StyleSheet.create({
  app: {
    flex: 1,
    backgroundColor: "#F9F9F9",
    padding: 15,
  },
  header: {
    flex: 0.5,
    backgroundColor: "red",
  },
  body: {
    flex: 5,
  },
  footer: {
    backgroundColor: "white",
    height: 70,
  },
  cardItem: {
    paddingBottom: 15,
  },
});
